import React from "react";
import { Box, Typography, Link } from "@mui/material";

const Header = () => {
  return (
    <Box
      sx={{
        height: "100vh",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        width: "100%",
      }}
    >
     <Typography variant='h1'>Classificador de Fake News</Typography>
    </Box>
  );
};

export default Header;
